import React, { Component } from "react";


class Login extends Component {


    render() {
        return (
            <React.Fragment>
                <div className="col form-group">
                    <h1 className="loginText" style={{ color: "#93329e" }}>Login</h1>

                    <form method="post" action="/login">
                        <p>
                            <label htmlFor="email">Email:</label>
                            <input type="text" id="email" name="emailLogin" />
                        </p>
                        <p>
                            <label htmlFor="password">Password:</label>
                            <input type="password" id="password" name="passwordLogin" />
                        </p>
                        <input className="btn" style={{ backgroundColor: "#ffd880" }} type="submit" value="Login!" />
                    </form>
                </div>



            </React.Fragment>

        )
    }
}


export default Login;
